import React, { useEffect, useState } from "react";
import axios from 'axios';

function Student() {
  const [id, setId] = useState('');
  const [name, setName] = useState("");
  const [address, setAddress] = useState("");
  const [fee, setFee] = useState("");
  const [students, setStudents] = useState([]);

  useEffect(() => {
    loadStudents();
  }, []);

  const loadStudents = async () => {
    try {
      const response = await axios.get("http://127.0.0.1:8000/student");
      setStudents(response.data);
    } catch (error) {
      console.error("Error loading students:", error);
    }
  };

  const saveStudent = async (event) => {
    event.preventDefault();
    try {
      await axios.post("http://127.0.0.1:8000/student", {
        name,
        address,
        fee
      });
      alert("Student Registered Successfully");
      clearForm();
      loadStudents();
    } catch (error) {
      console.error("Error saving student:", error);
      alert("Student Registration Failed");
    }
  };

  const editStudent = (student) => {
    setName(student.name);
    setAddress(student.address);
    setFee(student.fee);
    setId(student.id);
  };

  const deleteStudent = async (id) => {
    try {
      await axios.delete(`http://127.0.0.1:8000/student/${id}`);
      alert("Student deleted Successfully");
      clearForm();
      loadStudents();
    } catch (error) {
      console.error("Error deleting student:", error);
      alert("Student deletion Failed");
    }
  };

  const updateStudent = async (event) => {
    event.preventDefault();
    try {
      await axios.put(`http://127.0.0.1:8000/student/${id}`, {
        name,
        address,
        fee
      });
      alert("Student Updated Successfully");
      clearForm();
      loadStudents();
    } catch (error) {
      console.error("Error updating student:", error);
      alert("Student update Failed");
    }
  };

  const clearForm = () => {
    setId('');
    setName('');
    setAddress('');
    setFee('');
  };

  return (
    <div>
       <h1>Student Details</h1>
       <div className="container mt-4">
       <form onSubmit={saveStudent}> 
              <div className="form-group">
               <label>Student Name</label>
                <input  type="text" className="form-control" id="name"
                value={name}
                onChange={(event) =>
                  {
                    setName(event.target.value);      
                  }}
                />
              </div>
              <div className="form-group">
                <label>Address</label>
                <input  type="text" className="form-control" id="address"
                 value={address}
                  onChange={(event) =>
                    {
                     setAddress(event.target.value);      
                    }}
                />
              </div>
              <div className="form-group">
                <label>Fee</label>
                <input type="text" className="form-control" id="fee"
                  value={fee}
                onChange={(event) =>
                  {
                    setFee(event.target.value);      
                  }}
                />
              </div>
              <div>
                <button className="btn btn-primary mt-4" type="submit">Register</button> 
                <button className="btn btn-warning mt-4" onClick={updateStudent}>Update</button>
              </div>
            </form>
          </div>

          <table className="table table-dark" align="center">
            <thead>
              <tr>
                <th scope="col">Student Id</th>
                <th scope="col">Student Name</th>
                <th scope="col">Address</th>
                <th scope="col">Fee</th>
                <th scope="col">Option</th>
              </tr>
            </thead>
            <tbody>
              {students.map(student => (
                <tr key={student.id}>
                  <th scope="row">{student.id}</th>
                  <td>{student.name}</td>
                  <td>{student.address}</td>
                  <td>{student.fee}</td>        
                  <td>
                    <button className="btn btn-warning" onClick={() => editStudent(student)}>Edit</button>  
                    <button className="btn btn-danger" onClick={() => deleteStudent(student.id)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
       </div>
  );
}

export default Student;
